import React, { Component } from 'react';
import './App.css';
import Header from "./mm_header"
import Content from "./mm_content"
import {BrowserRouter, Route} from "react-router-dom";


const user_profile = [
  "Geesun Jang"
];

const NewRoute = () => {
  return (
      <div>
        <p>New Route</p>
      </div>
  );
}


class App extends Component {
  render() {
    return (
      <div className="App">
      <BrowserRouter>
        <Route path="/new" component={NewRoute} />
      </BrowserRouter>
        <Header/>
        <Content/>
      </div>
    );
  }
}

export default App;
